'<pre>',
'{  ',
'   "modus":"diagonal",',
'   "refresh":0,',
'   "minHeight":"450px",',
'   "transitionDuration":750,',
'   "rectangleWidth":150,',
'   "rectangleHeight":60,',
'   "rectangleSpacing":10,',
'   "rectangleColor":"rgba(41, 128, 185, 1)",',
'   "rectangleLeafColor":"rgba(121, 121, 121, 1)",',
'   "cutTextAfter":30,',
'   "textColor":"white"',
'}',
'</pre>',
'<br>',
'<h3>Explanation:</h3>',
'  <dl>',
'  <dt>modus (string)</dt>',
'  <dd>modus of the lines between the nodes (line, diagonal)</dd>',
'  <dl>',
'  <dt>refresh (number)</dt>',
'  <dd>refresh time of cards in seconds if 0 then no refresh will be set</dd>',
'  <dl>',
'  <dt>refresh (string)</dt>',
'  <dd>min height of the region</dd>',
'  <dl>',
'  <dt>transitionDuration (number)</dt>',
'  <dd>duration of the transitions</dd>',
'  <dl>',
'  <dt>rectangleWidth (number)</dt>',
'  <dd>width of the nodes</dd>',
'  <dl>',
'  <dt>rectangleHeight (number)</dt>',
'  <dd>height of the nodes</dd>',
'  <dl>',
'  <dt>rectangleSpacing (number)</dt>',
'  <dd>spacing between the nodes</dd>',
'  <dl>',
'  <dt>rectangleColor (string)</dt>',
'  <dd>color of a node when it''s not a leaf</dd>',
'  <dl>',
'  <dt>rectangleLeafColor (string)</dt>',
'  <dd>color of a node when it''s a leaf</dd>',
'  <dl>',
'  <dt>cutTextAfter(number)</dt>',
'  <dd>Cut the node text after this number of chars</dd>',
'  <dl>',
'  <dt>textColor (string)</dt>',
'  <dd>color of the node text</dd>'))
);
